import React, { Component } from "react";
import { Form, Button }  from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import {addActionCreator} from "../action/addActionCreator";
import { connect } from "react-redux";
import { bindActionCreators } from 'redux';
class HomeComponent extends Component {

    constructor() {

        super();
        this.state = {

            id: '',
            name: ''
            
        }
    }
    

    render() {
        console.log(this.props);
        
        return (
            
            <div className="App">

                <form class="form-inline">
                    <div class="form-group">

                        <input type="email" class="form-control" placeholder="Enter Id"/>
                       
                     </div>

                     <div class="form-group">

                            <input type="password" class="form-control" id="pwd" placeholder="Enter name"/>
                     
                     </div>
         
                                <button type="submit" class="btn btn-default">Submit</button>
                 </form>


            </div>
               );


    }

}
function mapDispatchToProps(dispatch) {
    return {
        st: () => dispatch(addActionCreator(3, 'alok'))
    }
}
export default connect(null,mapDispatchToProps)(HomeComponent);
